// D:\RoomieRadar\frontend\src\pages/RoommateMatch/RoommateMatch.jsx
import React, { useState } from "react";
import Card from "../../components/Card";
import Button from "../../components/Button";
import { useNavigate } from "react-router-dom";

const RoommateMatch = () => {
  const navigate = useNavigate();

  const [roommates] = useState([
    { id: 1, name: "Alex", compatibility: 92, top: true },
    { id: 2, name: "Jamie", compatibility: 88, top: false },
    { id: 3, name: "Taylor", compatibility: 85, top: false },
    { id: 4, name: "Morgan", compatibility: 80, top: false },
    { id: 5, name: "Casey", compatibility: 78, top: false },
  ]);

  const handleViewSimulation = (name) => {
    alert(`Viewing one-day simulation for ${name}`);
  };

  const handleCompare = (id) => {
    navigate(`/compare/${id}`);
  };

  return (
    <div className="container">
      <h1 className="heading-orange">Roommate Matches</h1>
      <div className="grid-cards">
        {roommates.map((rm) => (
          <Card key={rm.id} title={rm.name} highlight={rm.top}>
            <p>Compatibility: {rm.compatibility}%</p>
            <Button text="View Simulation" type="secondary" onClick={() => handleViewSimulation(rm.name)} />
            <Button text="Compare" type="primary" onClick={() => handleCompare(rm.id)} />
          </Card>
        ))}
      </div>
    </div>
  );
};

export default RoommateMatch;
